import React from "react";
const footer = ()=>{
    return(
        <>
        <div className="footer-main-wrp">
            <div className="center-wrapper">
                <div className="footer-container">
                    <div className="footer-block service-heading">
                        <h3>COMPANY ABOUT</h3>
                        <p>We is One Of The Fastest Growing Construction service Provider Company in Indore (M.P) India. We are one of the best civil contractor in India.</p>
                        <div className="social-icons">
                        <i class="fa fa-google" aria-hidden="true"></i>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        </>
    );
}
export default footer;
